Starring: Dylan Ryan, Jasmine Jem, Katsuni, Sinn Sage, Sovereign Syre
Reserved, slender brunette Beth has just gotten engaged to nice guy Liam, and travels home with him on holiday to meet his family. But when the self-conscious bride-to-be meets her fiancee`s sister Celine, she feels an instant connection tot he hauntingly beautiful, intense young woman. As Beth`s curiosity for her wild sister in law grows, Celine`s quest for pleasure mask a dark, disturbing secret? How much is Beth willing to risk to find out? Introducing new lesbian superstar Sovereign Syre in an unforgettable debut performance.
